webpackJsonp([0x9684d0f1d06c],{420:function(e,i){e.exports={data:{markdownRemark:{html:'<h1>Agenda</h1>\n<p><del>Join us for sig-apps on Wednesdays at 9am PDT on Zoom: zoom.us/my/sig.apps</del></p>\n<p>SIG-Apps meetings are now on <strong>Mondays at 9am PDT</strong> on Zoom: <a href="https://zoom.us/my/sig.apps">https://zoom.us/my/sig.apps</a></p>\n<p><em>Note, the <a href="https://docs.google.com/document/d/1LZLBGW2wRDwAfdBNHJjFfk9CFoyZPcIYGWU7R1PQ3ng/edit#">minutes and agenda have moved to Google Docs</a>.</em></p>\n<h2>August 17, 2016</h2>\n<ul>\n<li>Intro / Agenda</li>\n<li>\n<p>Brian Hardock of the Deis Helm team will demo <a href="www.github.com/kubernetes/helm">Helm</a>.</p>\n<ul>\n<li>Helm is a tool for creating and managing Kubernetes native applications.</li>\n</ul>\n</li>\n<li>Adnan Abdulhussein from Bitnami will walk us through example helm charts for Kubernetes native applications</li>\n</ul>\n<h2>August 10, 2016</h2>\n<ul>\n<li>Intro / Agenda</li>\n<li>PoC demo and discussion of <a href="https://github.com/kubernetes/kubernetes/issues/29453">AppController</a></li>\n<li>Working discussion of Pet Set beta steps led by <a href="https://twitter.com/smarterclayton">Clayton Coleman</a> and <a href="https://github.com/bprashanth">Prashanth B.</a></li>\n<li>Demo of <a href="https://github.com/metral/nanokube">nanokube</a> by <a href="https://twitter.com/mikemetral">Mike Metral</a></li>\n</ul>\n<h2>August 3, 2016 [<a href="minutes/2016-08-03.md">notes</a>]</h2>\n<ul>\n<li>Intro / Overview of Agenda</li>\n<li>\n<p><a href="https://twitter.com/ryanj?lang=en">Ryan Jarvinen</a> will talk about "Defining "Applications" for Kubernetes (and OpenShift)"</p>\n<ul>\n<li>In a world of distributed architecture, the term "Application" can be a difficult thing to define. RyanJ will provide a few examples of how to package and distribute applications for Kubernetes.</li>\n</ul>\n</li>\n<li>Open discussion / questions</li>\n</ul>\n<h2>July 27, 2016 [<a href="minutes/2016-07-27.md">notes</a>]</h2>\n<ul>\n<li>Intro</li>\n<li><a href="https://twitter.com/justicefries">Gerred Dillon</a> will do a demo of <a href="https://deis.com/">Deis</a></li>\n<li>Group discussion on Deis</li>\n<li>Matt Farina will give an update on results of the sig-apps survey</li>\n<li>Open discussion around sig-apps survey</li>\n</ul>\n<h2>July 20, 2016 [<a href="minutes/2016-07-20.md">notes &#x26; video</a>]</h2>\n<ul>\n<li>Intro</li>\n<li>Janet Kuo, Software Engineer at Google working on Kubernetes, will do a demo of deployment features in Kubernetes and give an overview of Deployments, Replica Sets, and Replication Controllers. (<em>needs confirmation</em>)</li>\n<li>Saad Ali, Software Engineer at Google working on Kubernetes, will do a demo and discussion around Volume features.</li>\n</ul>\n<h2>July 13, 2016 [<a href="minutes/2016-07-13.md">notes &#x26; video</a>]</h2>\n<ul>\n<li>Intro</li>\n<li>Christian from Jetstack will do a demo of Kube-Lego</li>\n<li><del>Mackenzie Burnett of Redspread will do a demo of <a href="https://github.com/redspread/spread">Spread</a></del></li>\n<li>Matt Farina will update us on the analysis of the SIG-Apps survey</li>\n</ul>\n<h2>July 6, 2016 [<a href="minutes/2016-07-06.md">notes &#x26; video</a>]</h2>\n<ul>\n<li>Intro</li>\n<li>\n<p><a href="https://twitter.com/chrislovecnm">Chris Love</a> will be talking about the covering deploying Cassandra on Kubernetes 1.3 at scale.</p>\n<ul>\n<li>Chris is a Senior DevOps Open Source Consultant for Datapipe, and head of DevOps RnD for Apollobit.</li>\n<li>His demo application is located at <a href="https://github.com/k8s-for-greeks/gpmr">https://github.com/k8s-for-greeks/gpmr</a>.</li>\n</ul>\n</li>\n<li>Open discussion / questions</li>\n</ul>\n<h2>June 29, 2016 [<a href="minutes/2016-06-29.md">notes &#x26; video</a>]</h2>\n<ul>\n<li>Intro</li>\n<li>Bart Spaans, author of <a href="https://github.com/opencredo/kubefuse/">KubeFuse</a>, will do a demo and discussion.</li>\n<li>The DRUD team from <a href="https://www.newmediadenver.com/">New Media Denver</a> will do a demo and discussion of how they use Kubernetes Jobs</li>\n<li>Follow up on SIG-Apps survey status</li>\n</ul>\n<h2>June 22, 2016 [<a href="minutes/2016-06-22.md">notes</a>]</h2>\n<ul>\n<li>Intro</li>\n<li>Antoine Legrand will demo <a href="https://github.com/kubespray/kpm">KPM</a></li>\n<li>Open discussion / questions</li>\n</ul>\n<h2>June 15, 2016 [<a href="minutes/2016-06-15.md">notes &#x26; video</a>]</h2>\n<ul>\n<li>Intro</li>\n<li>Eric Chiang of CoreOS will demo and discuss the freshly merged role based access control features in 1.3</li>\n<li>Ben Hall, founder of Katacoda, will talk about the Kubernetes scenarios on Katacoda.</li>\n</ul>\n<h2>June 8, 2016 [<a href="minutes/2016-06-08.md">notes &#x26; video</a>]</h2>\n<ul>\n<li>Intro</li>\n<li>Adnan Abdulhussein from Bitnami will demo the Stacksmith workflow</li>\n<li>Follow up on PetSet feedback</li>\n<li>Follow up on SIG-Apps survey status</li>\n</ul>\n<h2>May 31, 2016</h2>\n<ul>\n<li>Canceled in honor of a short week</li>\n</ul>\n<h2>May 25, 2016 [<a href="/k8s-c-sigs-demo/sig-apps/minutes/2016-05-25.md">notes &#x26; video</a>]</h2>\n<ul>\n<li>Intro</li>\n<li>Mike Metral of Rackspace will demo how to recursively process configuration files with the -R flag</li>\n</ul>\n<h2>May 18, 2016 [<a href="/k8s-c-sigs-demo/sig-apps/minutes/2016-05-18.md">notes</a>]</h2>\n<ul>\n<li>Intro</li>\n<li>Discussion on the future of SIG-Apps</li>\n<li>Pranshanth B. of Google will demo PetSet</li>\n</ul>'},site:{siteMetadata:{sigs:["sig-api-machinery","sig-apps","sig-architecture","sig-auth","sig-autoscaling","sig-aws","sig-azure","sig-big-data","sig-cli","sig-cloud-provider","sig-cluster-lifecycle","sig-cluster-ops","sig-contributor-experience","sig-docs","sig-gcp","sig-ibmcloud","sig-instrumentation","sig-multicluster","sig-network","sig-node","sig-openstack","sig-product-management","sig-release","sig-scalability","sig-scheduling","sig-service-catalog","sig-storage","sig-testing","sig-ui","sig-vmware","sig-windows"]}}},pathContext:{slug:"/sig-apps/agenda/"}}}});
